import React, { Component } from 'react';
import './AdminHome.css';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';
import {
  withRouter
} from 'react-router-dom';
import Form from 'react-bootstrap/Form';

class CompanyCard extends Component {
    render(){
        return(
            <Card bg="dark" text="white" style={{ width: '18rem' }} className="mb-2">
                <Card.Header text-menuAlign="centre">Company Name</Card.Header>
                <Card.Body>
                    <Card.Title> Card Title </Card.Title>
                    <Card.Text>
                Some quick example text to build on the card title and make up the bulk
                of the card's content.
                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}
class CompanyCards extends Component {
    constructor(props){
        super(props);
    }

    componentDidMount(){

    }
    render() {
        return(
            <div>
                <CompanyCard />
                <CompanyCard />

            </div>
        );
    }
}
class NavWithDropDown extends Component {
    render(){
        return(
            <Container>
                <Navbar fixed="top" id="top-navbar" bg="dark" variant="dark">
                        <Navbar.Brand href="/adminHome">StockChart</Navbar.Brand>
                        <Nav className="mr-auto">
                        <Nav.Link href="/importData">Import Data</Nav.Link>
                        <Nav.Link href="/company">Manage Company</Nav.Link>
                        <Nav.Link href="/exchange">Manage Exchange</Nav.Link>
                        <Nav.Link href="/ipo">Manage IPO</Nav.Link>
                        </Nav>

                        <Form inline id="search-box-full">
                            <FormControl id="search-box" type="text" placeholder="Search For Company" className="mr-sm-2" />
                            <Button variant="outline-info">Search</Button>
                        </Form>
                        
                        <DropdownButton menuAlign="right" title="Admin" id="dropdown-menu-align-right">
                            <Dropdown.Item eventKey="1" href="/update">Update Profile</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item eventKey="4" href="/">Logout</Dropdown.Item>
                        </DropdownButton>

                    </Navbar>
                    <br />
            </Container>
        );
    }
}
class AdminHome extends Component {
    render(){
        return(
            <div>
                <NavWithDropDown />
                <CompanyCards />
            </div>
            
        );
    }
}

export default AdminHome;
